                    <FormControlLabel
                      control={<Checkbox />}
                      label="Emergency Case"
                      name=""
                    />
                    <FormControlLabel
                      control={<Checkbox />}
                      label="OPD Case"
                      name=""
                    />
                    <FormControlLabel
                      control={<Checkbox />}
                      label="Others"
