                // type="time"
                name="pMemberMiddleName"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={6}>
              <TextField
                id="outlined-multiline-flexible"
                label="Last Menstrual Period :"
                // multiline
                // maxRows={4}
                fullWidth
                InputLabelProps={{ shrink: true }}
                type="date"
                name="pMemberMiddleName"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={6}></Grid>
          </Grid>
          <br />
          <Typography>
            <b>d. For TB DOTS PAckage :</b>
          </Typography>
          <br />
          <Grid container spacing={2}>
            <Grid item xs={4}>
              <Typography>
                Treatment Phase:
                <Switch
                  name=""
                  // checked={value === 1}
                  // onChange={handleChecked}
                  inputProps={{ "aria-label": "switch" }}
                />
                Intensive
              </Typography>
            </Grid>
            <Grid item xs={8}>
              <Typography>
                <Switch
                  name=""
                  // checked={value === 1}
                  // onChange={handleChecked}
                  inputProps={{ "aria-label": "switch" }}
                />
                Maintenance
              </Typography>
            </Grid>

            <Grid item xs={6}></Grid>
          </Grid>
          <br />
          <Typography>
            <b>
              e. For Animal Bite Package, Write the dates(mm-dd-yyyy) when the
              following doses of vacine was given:
              <br />
              Remiders: Anti Rabies Vaccine (ARV), Rabies Immunoglobulin (RIG){" "}
            </b>
          </Typography>
          <br />
          <Grid container spacing={2}>
            <Grid item xs={6}>
              <TextField
                id="outlined-multiline-flexible"
                label="Day 0  ARV"
                // multiline
                // maxRows={4}
                fullWidth
                InputLabelProps={{ shrink: true }}
                // type="date"
                name="pMemberMiddleName"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={6}>
              <TextField
                id="outlined-multiline-flexible"
                label="Day 3  ARV"
                // multiline
                // maxRows={4}
                fullWidth
                InputLabelProps={{ shrink: true }}
                // type="date"
                name="pMemberMiddleName"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={6}>
              <TextField
                id="outlined-multiline-flexible"
                label="Day 7  ARV"
                // multiline
                // maxRows={4}
                fullWidth
                InputLabelProps={{ shrink: true }}
                // type="date"
                name="pMemberMiddleName"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={6}>
              <TextField
                id="outlined-multiline-flexible"
